import React from "react"


function Message() {
    let d = new Date();
    let hour = d.getHours();
    let cssStyle = {};

    if (hour <= 11) {
        return(cssStyle.color = "blue", "Good Morning");
    }
    else if (hour <= 19) {
        return(cssStyle.color = "Yellow", "Good Afternoon");
    }
    else{
        return(cssStyle.color = "green", "Good Night");
    }
}

export default Message;
